import datetime
import re
from enum import Enum
from typing import List, Dict, Optional
import logging

# Set up logging
logging.basicConfig(level=logging.INFO)
logger = logging.getLogger(__name__)

# Enums and Constants
class SubmissionStatus(Enum):
    DRAFT = "Draft"
    SUBMITTED = "Submitted"
    IN_REVIEW = "In Review"
    APPROVED = "ApproVED"
    REJECTED = "Rejected"

class ActionType(Enum):
    CREATE = "CREATE"
    UPDATE = "UPDATE"
    DELETE = "DELETE"

class GTASWindow:
    @staticmethod
    def is_active() -> bool:
        """Check if GTAS window is currently active."""
        now = datetime.datetime.now().time()
        start_time = datetime.time(8, 0)  # 8 AM
        end_time = datetime.time(17, 0)   # 5 PM
        return start_time <= now <= end_time

# Models
class Submission:
    def __init__(self, submission_id: str, status: SubmissionStatus):
        self.submission_id = submission_id
        self.status = status
        self.history = []

    def update_status(self, new_status: SubmissionStatus) -> bool:
        """Update submission status and log the change."""
        if self.status == new_status:
            return False
        self.history.append({
            "timestamp": datetime.datetime.now(),
            "old_status": self.status,
            "new_status": new_status
        })
        self.status = new_status
        logger.info(f"Submission {self.submission_id} status changed from {self.status} to {new_status}")
        return True

class DataValidator:
    @staticmethod
    def validate_duns(duns: str, action_type: ActionType) -> bool:
        """Validate DUNS number based on action type."""
        if not duns or len(duns) != 9 or not duns.isdigit():
            return False

        if action_type == ActionType.CREATE:
            return duns.startswith(('0', '1'))
        elif action_type == ActionType.UPDATE:
            return True
        elif action_type == ActionType.DELETE:
            return duns.startswith('9')
        return False

    @staticmethod
    def validate_zip(zip_code: str, allow_short: bool = True) -> bool:
        """Validate ZIP code with optional short-form acceptance."""
        if not zip_code:
            return False
        if allow_short:
            return bool(re.fullmatch(r'\d{5}(-\d{4})?', zip_code))
        return bool(re.fullmatch(r'\d{5}-\d{4}', zip_code))

