class UIUpdater:
    @staticmethod
    def update_header_info(refresh_time: datetime.datetime = None) -> Dict:
        """Update header information with timestamp."""
        refresh_time = refresh_time or datetime.datetime.now()
        return {
            "last_refreshed": refresh_time.isoformat(),
            "system_status": "OK"
        }

    @staticmethod
    def get_navigation_options(user_role: str) -> List[str]:
        """Retrieve navigation options based on user role."""
        options = {
            "admin": ["Dashboard", "Submissions", "Reports", "Admin"],
            "user": ["Dashboard", "Submissions"],
            "validator": ["Dashboard", "Validation"]
        }
        return options.get(user_role, ["Dashboard"])

